	decodePayload(payload)

	payload, err = hex.DecodeString("")
	is.NoErr(err)

	decodePayload(payload)

	payload, err = hex.DecodeString("")
	is.NoErr(err)

	decodePayload(payload)

	payload, err = hex.DecodeString("")
	is.NoErr(err)

	decodePayload(payload)

	payload, err = hex.DecodeString("")
	is.NoErr(err)

	decodePayload(payload)

	payload, err = hex.DecodeString("")
	is.NoErr(err)

	decodePayload(payload)

	payload, err = hex.DecodeString("")
	is.NoErr(err)

	decodePayload(payload)

	is.True(true)
